import "/aboutus.css"

export default function Aboutus(){
    return(
        <div className="about-container">
            <h1>About Me</h1>
            <p>My name is Lalu and im an aspiring full stack web developer who wants to test my web designing abilities by giving my 100%.
            </p>
            <h1>My Mission</h1>
            <p>My mission is to become a successful full stack developer who meets the requirements of clients with astonishing work and ultimate transparency.</p>

        </div>
    )
}
